import './App.css';

class App extends React.Component{

  constructor(props){
    super(props)
    this.state = {
      items: [],
      isLoaded:  false,
    }
  }

  componentDidMount(){
    fetch('http://localhost:5000/')
      .then(res => res.json)
      .then(data => console.log(data))
  }

  render (){
    return(
    <div className="App">
      Canalytica
    </div>
  )
  }
}

export default App
